query ShowsQuery(
  $count: Int!
  $cursor: String
) {
  me {
    ...Shows_me_1G22uz
    __id
  }
}

fragment Shows_me_1G22uz on Me {
  followsAndSaves {
    shows(first: $count, after: $cursor) {
      pageInfo {
        startCursor
        endCursor
        hasPreviousPage
        hasNextPage
      }
      edges {
        node {
          ...ShowItemRow_show
          __id
          __typename
        }
        cursor
      }
    }
  }
  __id
}

fragment ShowItemRow_show on Show {
  id
  _id
  __id
  is_followed
  name
  partner {
    __typename
    ... on Partner {
      name
    }
    ... on Node {
      __id
    }
    ... on ExternalPartner {
      __id
    }
  }
  href
  exhibition_period
  status
  cover_image {
    url
    aspect_ratio
  }
  is_fair_booth
  start_at
  end_at
}
